      }}
    >
      <label>Name:</label>
      <input type="text" />
      <br />
      <br />
      <label>Description:</label>
      <input type="text" />
      <br />
      <br />
      <label>price:</label>
      <input type="number" />
      <br />
      <br />
      <button>Add Product</button>
    </form>
  );
};
